import { createApp } from 'vue'
import App from './App.vue'
import 'bootstrap'
import 'bootstrap/dist/css/bootstrap.min.css'
import router from './router.js'
import axios from 'axios'
createApp(App).use(router).mount('#app')
axios.get('http://43.200.120.63/api/Node1').then((data) => {
    console.log(data)
})
axios.get('http://43.200.120.63/api/Node2').then((data) => {
    console.log(data)
})
axios.get('http://43.200.120.63/api/Node3').then((data) => {
    console.log(data)
})
